import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';
import { Provider } from 'react-redux'
import thunk from 'redux-thunk'
import { createStore,  applyMiddleware, compose } from 'redux'
import rootReducer from './redux/reducers'
import {sessionService} from 'redux-react-session'
import axios from 'axios';
 

const mid = [thunk]
const store = createStore(rootReducer,
    
    compose(
    applyMiddleware(...mid),
    window.__REDUX_DEVTOOLS_EXTENSION__ && window.__REDUX_DEVTOOLS_EXTENSION__())
    );
const validateSession = (session) => {    
    if(!session.token) return false
    axios.post("https://hi-exchange.com/api/v2/token/refresh/", {
        refresh: session.refresh
    }).then(data=>{
        sessionService.deleteSession().then(e=>{
            sessionService.saveSession({token: data.data.access, refresh: session.refresh}).then(()=>{

                return true
            })

        });
    }) 
}
const options = { refreshOnCheckAuth: false, redirectPath: '/opt-1', validateSession };
sessionService.initSessionService(store, options)
ReactDOM.render(
    <Provider store={store}>
        <App />
    </Provider>

, document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
